import React from 'react';
import '../styles/MapView.css';
import TrafficCard from './TrafficCard';

const MapView = ({ trafficData }) => {
    return (
        <div className="map-view">
            <h2>Traffic Map</h2>
            <div className="map-container">
                {/* Here you can integrate a mapping library like Leaflet or Google Maps */}
                <img src="https://via.placeholder.com/600x400" alt="Map Placeholder" className="map-placeholder" />
                <div className="traffic-cards">
                    {trafficData.map(data => (
                        <TrafficCard key={data.id} location={data.location} congestionLevel={data.congestionLevel} />
                    ))}
                </div>
            </div>
        </div>
    );
};

export default MapView;
